import React from 'react'

const VideoCard = ({info}) => {
    console.log(info)
  return (
    <div className='overflow-hidden h-66'>
        <img alt="thumbnail" className='h-60' src={info?.thumbnails?.high?.url}/>
        <div>{info?.title}</div>
        <div>{info?.channelTitle}</div>

    </div>
  )
}

export default VideoCard
